sympy.sympy.polys.domains.domain.is_one:
def is_one(self, a: Er) -> bool:
    """Returns True if ``a`` is one. """
    return a == self.one

sympy.sympy.polys.domains.integerring.gc:
def gcdex(self, a: MPZ, b: MPZ) -> tuple[MPZ, MPZ, MPZ]:
    """Compute extended GCD of ``a`` and ``b``. """
    h, s, t = gcdex(a, b)
    # XXX: This conditional logic should be handled somewhere else.
    if GROUND_TYPES == 'gmpy':
        return s, t, h
    else:
        return h, s, t

sympy.sympy.polys.domains.old_polynomial:
def gcdex(self, a, b):
    """Extended GCD of ``a`` and ``b``. """
    return a.gcdex(b)
